jet.add("log",function(c){var a=jet.namspace("Log");if(!a.errors)a.errors=[];if(!a.warnings)a.warnings=[];if(!a.logs)a.logs=[];c.add({error:function(b){a.errors.push(b)},warning:function(b){a.warnings.push(b)},log:function(b){a.logs.push(b)}})});
